/**
 * 🇬🇧 One Repetition Max (1RM) Calculator with percentage chart
 * 🇫🇷 Calculateur de 1 répétition maximale (1RM) avec tableau de pourcentages
 */

import React, { useState, useCallback } from 'react';

/**
 * 🇬🇧 Percentage table used to estimate load based on 1RM
 * 🇫🇷 Tableau de pourcentages pour estimer les charges selon le 1RM
 */
const percentageTable = [
  { reps: 1, percentage: 100 },
  { reps: 2, percentage: 95 },
  { reps: 3, percentage: 90 },
  { reps: 4, percentage: 88 },
  { reps: 5, percentage: 86 },
  { reps: 6, percentage: 85 },
  { reps: 7, percentage: 82 },
  { reps: 8, percentage: 80 },
  { reps: 9, percentage: 78 },
  { reps: 10, percentage: 75 },
  { reps: 11, percentage: 73 },
  { reps: 12, percentage: 70 },
  { reps: 13, percentage: 68 },
  { reps: 14, percentage: 66 },
  { reps: 15, percentage: 64 },
  { reps: 20, percentage: 60 },
];

const OneRMCalculator = () => {
  /**
   * 🇬🇧 Form state values
   * 🇫🇷 États des champs de formulaire
   */
  const [weight, setWeight] = useState('');
  const [reps, setReps] = useState('');
  const [oneRM, setOneRM] = useState(null);

  /**
   * 🇬🇧 Handle calculation using O'Connor formula
   * 🇫🇷 Gérer le calcul avec la formule d'O'Connor
   */
  const calculateOneRM = useCallback((e) => {
    e.preventDefault();
    const weightNum = parseFloat(weight);
    const repsNum = parseFloat(reps);

    if (weightNum > 0 && repsNum > 0) {
      const result = weightNum * (1 + 0.025 * repsNum);
      setOneRM(Math.round(result * 100) / 100); // Round to 2 decimals
    }
  }, [weight, reps]);

  return (
    <div className="max-w-4xl mx-auto p-6 bg-white rounded-lg shadow-lg">
      {/* 🏋️ Titre principal */}
      <h2 className="text-2xl font-bold mb-6 text-center text-gray-800">
        Calculateur 1RM (One Rep Max)
      </h2>

      {/* 📥 Formulaire d'entrée */}
      <form onSubmit={calculateOneRM} className="mb-8">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-4">
          <div>
            <label htmlFor="weight" className="block text-sm font-medium text-gray-700 mb-1">
              Poids soulevé (kg)
            </label>
            <input
              type="number"
              id="weight"
              value={weight}
              onChange={(e) => setWeight(e.target.value)}
              className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
              min="0"
              step="0.5"
              required
            />
          </div>

          <div>
            <label htmlFor="reps" className="block text-sm font-medium text-gray-700 mb-1">
              Nombre de répétitions
            </label>
            <input
              type="number"
              id="reps"
              value={reps}
              onChange={(e) => setReps(e.target.value)}
              className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
              min="1"
              max="20"
              required
            />
          </div>
        </div>

        <button
          type="submit"
          className="w-full bg-blue-600 text-white py-2 px-4 rounded-md hover:bg-blue-700 transition-colors"
        >
          Calculer 1RM
        </button>
      </form>

      {/* 📊 Résultat calculé */}
      {oneRM !== null && (
        <div className="mb-8 p-4 bg-green-50 border border-green-200 rounded-md">
          <p className="text-center text-lg font-semibold text-green-800">
            Votre 1RM estimé : {oneRM} kg
          </p>
        </div>
      )}

      {/* 📈 Tableau des pourcentages */}
      <div className="overflow-x-auto">
        <table className="w-full border-collapse">
          <thead>
            <tr className="bg-gray-100">
              <th className="px-4 py-2 border text-left">Répétitions</th>
              <th className="px-4 py-2 border text-left">% Charge max</th>
              {oneRM !== null && (
                <th className="px-4 py-2 border text-left">Poids (kg)</th>
              )}
            </tr>
          </thead>
          <tbody>
            {percentageTable.map(({ reps, percentage }) => (
              <tr key={reps} className="hover:bg-gray-50">
                <td className="px-4 py-2 border">{reps}</td>
                <td className="px-4 py-2 border">{percentage}%</td>
                {oneRM !== null && (
                  <td className="px-4 py-2 border">
                    {Math.round((oneRM * percentage) / 100 * 100) / 100}
                  </td>
                )}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default OneRMCalculator;
